          <Route exact path='/' element={<Login />} />
          <Route exact path='/dashboard' element={Dashboard}>
            <Route exact path='/dashboard/tracenet' element={TracenetForm} />
            <Route exact path='/dashboard/download' element={Download} />
            <Route exact path='/dashboard/upload_status' element={Upload} />
            <Route exact path='/dashboard/user' element={Create_user} />
            <Route exact path='/dashboard/user-detail' element={User_detail} />
            <Route exact path='/dashboard/user-update' element={Update_user} />
          </Route>
        </Routes> */}
      </div>

  );
}

export default App;
